import React from "react";
import "./Footer.css";
import logo from '../assets/icons/niji.svg';

function Footer() {
    return (
        <footer>
            <div className="logo-container">
                <img src={logo} alt="Logo" />
            </div>
        </footer>
        )
}

export default Footer;
